import { BrowserRouter ,  Routes, Route,  } from "react-router-dom";

import "./App.css";
import Navbar from "./Komponensek/Navbar/Navbar";
import Fooldal from "./Komponensek/Oldalak/Fooldal";
import LoginSignup from "./Komponensek/Oldalak/LoginSignup";
import Menu from "./Komponensek/Oldalak/Menu";
import Rendeles from "./Komponensek/Oldalak/Rendeles";

function App() {
  return (
    <div className="App">

    <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path="/" element={<Fooldal />} catergory="Főoldal" />
          <Route path="/login" element={<LoginSignup />} catergory="Bejelentkezés" />
          <Route path="/menu" element={<Menu />}  catergory/>
          <Route path="/rendeles" element={<Rendeles />} />
        </Routes>
        </BrowserRouter>
    </div>
  );
}

export default App;
